import React from 'react';
import {Container, Row, Col } from 'react-bootstrap';
import ReadyPetGo from '../images/ReadyPetGo.png';

const RPG = () => {
    return(
        <div className='App-header'>
            <br/>
            <h1>Ready Pet Go</h1>
            <br/>
            <img alt="Manish" src={ReadyPetGo}/>
        </div>
    );
}

export default RPG;
